import React from 'react';
import ReactDOM from 'react-dom';
import './style.css';

// import './index.css';
import RectButton from './components/RectButton.js';
import CircleButton from './components/CircleButton.js';
import InputText from './components/InputText.js';
// import * as serviceWorker from './serviceWorker';

// ReactDOM.render(<CircleButton text="button" textColor="black" background="gray" />, document.getElementById('root'));

ReactDOM.render(<CircleButton type="profile" />, document.getElementById('root'));


ReactDOM.render(<InputText type="text" placeholder="Username" />, document.getElementById('root'));
